import React from "react";
import StartScreenImg from './images/start-screen-img.png' 

const StartScreen = () => {
  return(
    <section className="start-screen">
      <div className="container">
        <div className="start-screen__wrapper">
          <div className="start-screen__content">
            <h1 className="start-screen__title">Not only people need a house</h1>
            <p className="start-screen__desc">We offer to give a chance to a little and nice puppy with an extremely wide and open heart. He or she will love you more than anybody else in the world, you will see!</p>
            <button className="start-screen__btn">Make a friend</button>
          </div>
          <img src={StartScreenImg} alt="Puppy" className="start-screen__img" />
        </div>
      </div>
    </section>
  );
};

export default StartScreen;
